import home from "./pages/home";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" component={home} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
